                 <div className='col-6' style={{color:"424242"}}>
                    <h2 >Trust with confidence</h2>
                 </div>
                 <div className='col-6'>
                    <img src="/media/images/ecosystem.png" alt="ecosystem" style={{width:"90%"}} />
                    </div>  
            </div>
        </div>
     );
}

export default Stats;
